@EU_Commission Forget your “Reform Delivery Tool”.

You can no longer use our bank savings, pensions and public resources as guarantee for the next bank or state default.

Move on. There’s no law that says EU should stand with creditors or be the debt collector of its banks.

@EU_Commission And financial punishment of Visigrad group countries for not towing the ‘replacement by mass immigration’ line. 

Blatant political blackmail and utter lack of democratic mandate on this issue. 
This will cause the EU economic project, that has brought much prosperity, to FAIL.

@EU_Commission
Better regulation for imigration matters, promote the values of western civilization within the EU borders.
Secure borders of EU, and at the same time expand carefully these borders to countries willing to adopt EU values.
